import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchExperiences } from '../actions/experienceActions';
import './ExperiencePage.css';

const ExperiencePage = () => {
  const dispatch = useDispatch();
  const experiences = useSelector((state) => state.experiences);

  useEffect(() => {
    dispatch(fetchExperiences());
  }, [dispatch]);

  return (
    <div className="experience-page">
      <h1>Experience</h1>
      <ul>
        {experiences.map((experience) => (
          <li key={experience.id}>
            <p>{experience.description}</p>
            {experience.photos.map((photo, index) => (
              <img key={index} src={photo} alt="Experience" />
            ))}
            <a href={experience.link} target="_blank" rel="noopener noreferrer">Experience Link</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ExperiencePage;
